import React from 'react';
import img from '../src/images/1.jpg';
import img1 from '../src/images/2.jpg';
import img2 from '../src/images/4.jpg';

const Cdata = [

        {
            id : 1,
            title : "Awesome Card",
            imgSrc : img,

        },
        {
            id : 2,
            title : "Awesome 2",
            imgSrc : img1,

        },
        {
            id : 3,
            title : "Awesome 3",
            imgSrc : img2,
        },

];

export default Cdata;
